import React, { useState } from 'react'
import { Link } from 'react-router-dom'

const LoginRegister = () => {
	const [username, setUsername] = useState('')
	const [password, setPassword] = useState('')
	const [repassword, setRepassword] = useState('')
	const [usernameBlur, setUsernameBlur] = useState(false)
	const [passwordBlur, setPasswordBlur] = useState(false)
	const [repasswordBlur, setRepasswordBlur] = useState(false)
	const [usernameError, setUsernameError] = useState(['', false])
	const [passwordError, setPasswordError] = useState(['', false])
	const [repasswordError, setRepasswordError] = useState(['', false])

	const onBlurInput = () => {
		if (username === '') setUsernameBlur(false)
		if (username.trim !== '') setUsernameBlur(true)

		if (password === '') setPasswordBlur(false)
		if (password.trim !== '') setPasswordBlur(true)

		if (repassword === '') setPasswordBlur(false)
		if (repassword.trim !== '') setRepasswordBlur(true)
	}
	const handleChange = (e) => {
		if (e.target.name === 'username') setUsername(e.target.value)
		if (e.target.name === 'password') setPassword(e.target.value)
		if (e.target.name === 'repassword') setRepassword(e.target.value)
	}
	const handleSubmit = (e) => {
		e.preventDefault()
		setUsernameError(['User name must be at least 6 characters', true])
		setPasswordError(['Password must be at least 6 characters', true])
		setRepasswordError(['Re password must match to pas', true])
	}
	return (
		<>
			<div className='limiter'>
				<div className='container-login100'>
					<div className='wrap-login100 p-l-55 p-r-55 p-t-65 p-b-54'>
						<form className='login100-form validate-form'>
							<span className='login100-form-title p-b-49'>
								{' '}
								Register{' '}
							</span>

							<div
								className={
									usernameError[0] !== ''
										? 'wrap-input100 validate-input m-b-23 alert-validate'
										: 'wrap-input100 validate-input m-b-23'
								}
								data-validate={usernameError[0]}
							>
								<span className='label-input100'>Username</span>
								<input
									className={
										(usernameBlur === true
											? 'input100 has-val'
											: 'input100',
										usernameError[1] === true
											? 'alert-validate input100 has-val'
											: 'input100')
									}
									type='text'
									name='username'
									placeholder='Type your username'
									value={username}
									onBlur={() => onBlurInput()}
									onChange={(e) => handleChange(e)}
								/>
								<span
									className='focus-input100'
									data-symbol='&#xf206;'
								></span>
							</div>

							<div
								className={
									passwordError[0] !== ''
										? 'wrap-input100 validate-input alert-validate'
										: 'wrap-input100 validate-input'
								}
								data-validate={passwordError[0]}
							>
								<span className='label-input100'>Password</span>
								<input
									className={
										(passwordBlur === true
											? 'input100 has-val'
											: 'input100',
										passwordError[1] === true
											? 'alert-validate input100 has-val'
											: 'input100')
									}
									type='password'
									name='password'
									placeholder='Type your password'
									value={password}
									onBlur={() => onBlurInput()}
									onChange={(e) => handleChange(e)}
								/>
								<span
									className='focus-input100'
									data-symbol='&#xf190;'
								></span>
							</div>

							<div
								className={
									passwordError[0] !== ''
										? 'wrap-input100 validate-input alert-validate'
										: 'wrap-input100 validate-input'
								}
								data-validate={passwordError[0]}
							>
								<span className='label-input100'>
									Re-Password
								</span>
								<input
									className={
										(passwordBlur === true
											? 'input100 has-val'
											: 'input100',
										passwordError[1] === true
											? 'alert-validate input100 has-val'
											: 'input100')
									}
									type='password'
									name='re-password'
									placeholder='Re enter password'
									value={password}
									onBlur={() => onBlurInput()}
									onChange={(e) => handleChange(e)}
								/>
								<span
									className='focus-input100'
									data-symbol='&#xf190;'
								></span>
							</div>

							<div className='container-login100-form-btn'>
								<div className='wrap-login100-form-btn'>
									<div className='login100-form-bgbtn'></div>
									<button
										className='login100-form-btn'
										onClick={(e) => handleSubmit(e)}
									>
										Sign Up
									</button>
								</div>
							</div>
						</form>
					</div>
				</div>
			</div>

			<div id='dropDownSelect1'></div>
		</>
	)
}

export default LoginRegister
